import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const CartDiv = styled.div``;

const Cart = () => {
  return (
    <CartDiv>
      <Link to="/cart">
        <img src="./static/cart.png" alt="cart" width="50px" height="50px" />
      </Link>
    </CartDiv>
  );
};

export default Cart;
